package llc.arma.checklisttag.net;import java.util.List;import llc.arma.checklisttag.db.model.SmartObject;import retrofit2.Call;import retrofit2.http.Field;import retrofit2.http.FormUrlEncoded;import retrofit2.http.GET;import retrofit2.http.POST;import retrofit2.http.Query;public interface WebApi {    @POST("auth")    Call<WebResponse> auth(@Query("login") String login, @Query("pass") String pass,                           @Query("deviceid") String deviceid);    @FormUrlEncoded    @POST("in")    Call<WebResponse> sendObject(@Field("token") String token, @Field("deviceid") String deviceid,                                 @Field("msg") String msg, @Field("id") String id);    @GET("lib")    Call<String> getTreeData(@Query("token") String token);}